
var username;

$(document).ready(function () {	
	$.ajax(
	{           	
		url: "../load.php",
		type: "POST",
		async:false,
		success: function (return_name) {
			return_name = return_name.replace(/^\s+|\s+$/g,"");
			user_name = return_name.toString();
			//alert(username);
			if(user_name.length <6){
				//alert(username);
				document.location = '../welcome page/index.html '; // session expired
			}
			username = user_name;
			//alert(user_name);
		}
	});
});

$(window).load(function() {
	$.ajax({
               url: "getPhotoaddr.php", //你处理上传文件的服务端
               type:"POST",
               data: "user_id=" + username,
			   cache: false, 
               dataType: 'JSON',
               success: function (result) {
					if(result.pic!=null){
						//alert(result.pic.toString());
						var tem_url = timestamp(result.pic.toString());
						//alert(tem_url);
						document.getElementById("currentphoto").src= tem_url.toString();
					}
               }
        })
	//$('#btnCrop').click();$("#idName").css("cssText","background-color:red!important");
	
	//$(".imageBox").css("cssText","background-position:88px 88px!important");$(".imageBox").css("cssText","background-size:222px 222px!important");
	var options =
	{
		thumbBox: '.thumbBox',
		spinner: '.spinner',
		imgSrc: ''
	}
	var cropper = $('.imageBox').cropbox(options);
	var img="";
	$('#upload-file').on('change', function(){
		var reader = new FileReader();
		reader.onload = function(e) {
			options.imgSrc = e.target.result;
			//alert(options.imgSrc);
			cropper = $('.imageBox').cropbox(options);
		}
		reader.readAsDataURL(this.files[0]);
		this.files = [];
		//getImg();
	})
	
	$('#btnOK').on('click', function(){
		var tem = cropper.getDataURL();
		//var tem = 'data:image/png;base64,';
		tem=tem.replace(/\+/g,"%2B");
		tem=tem.replace(/\&/g,"%26");
		//alert (tem);
		//document.getElementById("currentphoto").src= tem.toString();
		$.ajax({
               url: "updatePhoto.php", //你处理上传文件的服务端
               type:"POST",
               data: "username=" + username + "&img=" + tem,
               //dataType: 'JSON',
               success: function (result) {
				   //alert(result);	
					swal({ 
						title: "Successful!",  
				            text: "Your photo has been updated!",  
				            type: "success", 
				            showCancelButton: false, 
				            closeOnConfirm: false, 
				            confirmButtonText: "OK", 
				            confirmButtonColor: "#ec6c62" 
					}, function() { 
						location.reload(true);
					});				   
               }
        })
	})
		
	$('#btnZoomIn').on('click', function(){
		cropper.zoomIn();
	})
	$('#btnZoomOut').on('click', function(){
		cropper.zoomOut();
	})
});

function timestamp(url){
     //  var getTimestamp=Math.random();
       var getTimestamp=new Date().getTime();
      if(url.indexOf("?")>-1){
        url=url+"&timestamp="+getTimestamp
      }else{
        url=url+"?timestamp="+getTimestamp
      }
      return url;
    }